import React from "react";
import "./App.css";
import expenso from './images/expenso.png';

function Expenso() {
    return(
    <div>
        <div className="left">
            <img src={expenso} alt="expenso-logo"/>
        </div>
        <div className="right">
            <p>My two teammates and I created this application for Stem Warrior Hacks to help 
                students plan their expenses and record 
            </p>
        </div>
    </div>
    )
}

export default Expenso;
